import React from "react"; 
import IndividualProjects from "./individualProjects";
import GroupProjects from "./groupProjects";
import { Container, Tabs, Tab } from "react-bootstrap";
import "./projects.css";

const Projects = () => {
    return (
    <Container>
        <Tabs defaultActiveKey="projects" id="uncontrolled-tab-example">

        <Tab eventKey="IndividualProjects" title="Individual Projects">            
            <IndividualProjects></IndividualProjects>
        </Tab>

        <Tab eventKey="GroupProjects" title="Group Projects">          <GroupProjects></GroupProjects>
        </Tab>
        </Tabs>

    </Container>      

    )
}

export default Projects;
